import { Component } from "react";
import './App.css';
import {moviedata} from './Moviedata';


class Movielist extends Component {
        render() {
            return (
                <div className="container text-center">
                      <div className="row">
    <div className="col">
      1 of 2
    </div>
    <div className="col">
      2 of 2
    </div>
  </div>
  <div className="row">
    <div className="col">
      1 of 3
    </div>
    <div className="col">
      2 of 3
    </div>
    <div className="col">
      3 of 3
    </div>
  </div>

                    <h1>
                        Horror Movies <i></i> 
                    </h1>
                    <ul> {moviedata.map((item, index)=>{
                        return(
                             <ul key={index}>
                        <a href={item.URL} className={item.cName}>
                    <i className={item.icon}></i>{item.title}
                    </a>
                  </ul>
                    )
                    })}

                </ul>   
                         </div>

            )
        }
    }

    export default Movielist
